import java.util.Arrays;
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        Animal[] animals = new Animal[n];
        for (int i = 0; i < n; i++) {
            int type = scanner.nextInt();
            String name = scanner.next();
            int age = scanner.nextInt();
            switch (type) {
                case 1:
                    int leg = scanner.nextInt();
                    animals[i] = new Dog(name, age, leg);
                    break;
                default:
                    animals[i] = new Bird(name, age);
                    break;
            }
        }
        System.out.println(Arrays.toString(animals));
        String searchName = scanner.next();
        scanner.close();
        int cnt = 0;
        for (Animal animal : animals) {
            if (animal.getName().equals(searchName)) {
                System.out.println(animal.getClass().getSimpleName());
                System.out.println(animal);
                cnt++;
            }
        }
        if (cnt == 0) {
            System.out.println("no this one");
        }
    }
}

abstract class Animal {
    private String name;
    private int age;

    public Animal(String name, int age) {
        this.name = name;
        this.age = age;
    }

    public String getName() {
        return name;
    }

    @Override
    public String toString() {
        return "Animal[name=" + name + ", age=" + age + "]";
    }

    public void setName(String name) {
        this.name = name;
    }

    public int getAge() {
        return age;
    }

    public void setAge(int age) {
        this.age = age;
    }
}

class Bird extends Animal {
    Bird(String name, int age) {
        super(name, age);
    }

    @Override
    public String toString() {
        return "Bird[name=" + getName() + ", age=" + getAge() + "]";
    }
}

class Dog extends Animal {
    private int leg;

    public Dog(String name, int age, int leg) {
        super(name, age);
        this.leg = leg;
    }

    public int getLeg() {
        return leg;
    }

    public void setLeg(int leg) {
        this.leg = leg;
    }

    @Override
    public String toString() {
        return "Dog[leg=" + leg + ", name=" + getName() + ", age=" + getAge() + "]";
    }
}
